<?php

namespace App\Core;

class Security
{

    private function block(): bool|string {

        header(header: "HTTP/1.1 403 Forbidden");
        $html = base64_decode(string: "");
        return $html;

    }

    private function antiXSS(): void
    {
        if (!empty($_GET)) {
            
            foreach ($_GET as $key => $value) {
                
                if (strpos(haystack: $key, needle: '<') !== false || strpos(haystack: $key, needle: '>') !== false ||
                    strpos(haystack: $value, needle: '<') !== false || strpos(haystack: $value, needle: '>') !== false) {
                    echo $this->block();
                    exit();
                }
            }
        }

        $inputData = file_get_contents(filename: 'php://input');
        
        if (!empty($inputData)) {
            $decodedInput = json_decode(json: $inputData, associative: true);

            if (json_last_error() === JSON_ERROR_NONE) {
                foreach ($decodedInput as $key => $value) {
                    if (strpos(haystack: $key, needle: '<') !== false || strpos(haystack: $key, needle: '>') !== false ||
                        strpos(haystack: $value, needle: '<') !== false || strpos(haystack: $value, needle: '>') !== false) {
                        echo $this->block();
                        exit();
                    }
                }
            } else {
                parse_str(string: $inputData, result: $postData);
                foreach ($postData as $key => $value) {
                    if (strpos(haystack: $key, needle: '<') !== false || strpos(haystack: $key, needle: '>') !== false ||
                        strpos(haystack: $value, needle: '<') !== false || strpos(haystack: $value, needle: '>') !== false) {
                        echo $this->block();
                        exit();
                    }
                }
            }
        }
    }


    private function allSecurityHeader(): void
    {

        header(header: "Strict-Transport-Security: max-age=31536000; includeSubDomains; preload");
        header(header: "Content-Security-Policy: default-src 'self'; script-src 'self' 'unsafe-inline' 'unsafe-eval'; style-src 'self' 'unsafe-inline'; img-src 'self' data:; font-src 'self';");
        header(header: "X-Content-Type-Options: nosniff");
        header(header: "X-Frame-Options: DENY");
        header(header: "X-XSS-Protection: 1; mode=block");
        header(header: "Referrer-Policy: strict-origin-when-cross-origin");

    }

    private function header(): void
    {

        header(header: "Server: Hiddened");

    }

    public function __construct()
    {

        // Basic

        $this->header();

        // Advance

        (ALL_SECURITY_HEADERS) ? ($this->allSecurityHeader()) : null;
        (ANTI_XSS) ? ($this->antiXSS()) : null;

    }

}
